import React from 'react';
import './Reserve.css'

let Reserve = (props) => {

    return (
        <button className='Card2' symbol = {props.symbol} id={props.name} >
        <p><b>{props.name}</b> ({props.reserve} {props.symbol})</p>
    </button>) }

export default Reserve
